"""### Here the architecture of choice has been FaceNet ready lib from pytorch, where we will be using MTCNN Specifically - Multi Task Cascaded Neural Net)

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

### Aproach

* MTCNN algorithm uses a cascading series of neural networks to detect, align, and extract facial features from digital images with high accuracy and speed.

### In short the algorithm consists of 3 stages -
* 1. Proposal Network (P-Net) - Where we first generate a set of candidate bboxes that may contain a face.

* 2. Refinement Network (R-Net) -
Which refines the candidate bboxes generated by P-Net.
* 3. Output Network (O-Net) - Final stage where O-Net further refines bboxes and extracts facial landmarks.

### Implementation --

* We used a pre-trained FaceNet model (InceptionResnetV1 trained on VGGFace2) ,
the implementation consists of 3 stages, transfer learning works great here as features learned on VGGFace2 transfer excellently to LFW dataset.
1. Preprocessing - detection alignment and norm
2. Embedding Generation - cnn feature extraction
3. Similarity Measurement - cosine similarity between embeddings
4. Decision - Classification

* For preprocessing / feature alignment we use 5 key facial landmarks : Detect landmarks using MTCNN O-Net
Compute similarity transform to canonical pose
Warp image to align eyes horizontally, nose centered.

* Then we normalize , Resize to 160160 pixels
Convert to RGB
Normalize pixel values to [-1, 1] range

* We chose MTCNN as it provides both face detection and 5-point facial landmarks in one pass. The landmarks (eyes, nose, mouth corners) are essential for the alignment step that follows.

Alternatives considered:

RetinaFace: More accurate but added complexity for standard RGB faces,
Dlib HOG: Fast but less accurate than deep learning approaches

* we use cosine similarity as the distance metric as FaceNet's Triplet Loss implicitly optimizes embeddings to work well with cosine distance. Using the same metric at inference time that the model was trained for gives better results.


### Metrics

* The EER is the point where False Accept Rate (FAR) equals False Reject Rate (FRR). This gives us a balanced baseline without making assumptions about the application.

Application-agnostic: EER doesn't favor low false accepts or low false rejects - it treats both errors equally. Perfect starting point before tuning for specific use cases.

Standard metric: Industry-standard evaluation point for biometric verification systems
"""

