import torch
import numpy as np
from PIL import Image
import matplotlib.pyplot as plt
from sklearn.datasets import fetch_lfw_pairs
from sklearn.metrics import roc_curve, auc
from facenet_pytorch import MTCNN, InceptionResnetV1
from tqdm import tqdm
import warnings
warnings.filterwarnings('ignore')

"""* FaceNet: InceptionResnetV1 pre-trained on VGGFace2. This produces 512-d embeddings optimized for face verification

* MTCNN: Face detection + alignment - MTCNN handles both detection AND alignment internally
"""

device = torch.device("cuda" if torch.cuda.is_available() else "cpu")

mtcnn = MTCNN(
    image_size=160,          # FaceNet expects 160x160 input
    margin=0,
    min_face_size=20,        # Minimum detectable face size
    thresholds=[0.6, 0.7, 0.7],  # P-Net, R-Net, O-Net confidence thresholds
    factor=0.709,            # Scale factor for image pyramid
    post_process=True,       # Apply normalization automatically
    device=device,
    keep_all=False           # Return only best face
)


net = InceptionResnetV1(pretrained='vggface2').eval().to(device)

print(f"MTCNN loaded on {device}")
print(f"FaceNet (InceptionResnetV1) loaded on {device}")
print(f"Pre-training: VGGFace2 (3.3M images, 9K identities)")
print(f"Embedding dimension: 512")

"""## 2. Face processing pipeline


"""

def get_face_embedding(img_pil):
    try:
        if isinstance(img_pil, np.ndarray):
            # LFW images are float in [0, 1]
            if img_pil.dtype in [np.float32, np.float64]:
                img_pil = (img_pil * 255).astype(np.uint8)
            img_pil = Image.fromarray(img_pil)
        if img_pil.mode != 'RGB':
            img_pil = img_pil.convert('RGB')

        face_tensor = mtcnn(img_pil)
        if face_tensor is None:
            return None
        with torch.no_grad():
            face_tensor = face_tensor.unsqueeze(0).to(device)
            embedding = net(face_tensor)
            embedding = embedding.cpu().numpy().flatten()
            embedding = embedding / np.linalg.norm(embedding)
            return embedding
    except Exception as e:
        return None



def compute_similarity(emb1, emb2):
    return np.dot(emb1, emb2)


def verify_pair(img1, img2, threshold=0.5):
    emb1 = get_face_embedding(img1)
    emb2 = get_face_embedding(img2)

    if emb1 is None or emb2 is None:
        return False, 0.0
    similarity = compute_similarity(emb1, emb2)

    decision = similarity >= threshold

    return decision, float(similarity)

"""### 4. Evaluation on LFW pairs

"""

def compute_similarity_scores(pairs_data, max_pairs=2000):
    n_pairs = min(max_pairs, len(pairs_data.pairs))
    similarities = []
    labels = []
    failed = 0

    for i in tqdm(range(n_pairs), desc="Processing pairs"):
        img1, img2 = pairs_data.pairs[i]
        label = pairs_data.target[i]
        img1_pil = Image.fromarray((img1 * 255).astype(np.uint8))
        img2_pil = Image.fromarray((img2 * 255).astype(np.uint8))

        _, similarity = verify_pair(img1_pil, img2_pil)
        if similarity != 0.0:
            similarities.append(similarity)
            labels.append(label)
        else:
            failed += 1

    if len(similarities) == 0:
        raise RuntimeError(f"All {failed} pairs failed! Check MTCNN/FaceNet installation.")

    return np.array(similarities), np.array(labels), failed



def compute_metrics(similarities, labels):
    # ROC curve
    fpr, tpr, thresholds = roc_curve(labels, similarities)
    roc_auc = auc(fpr, tpr)

    # Equal Error Rate (EER)
    fnr = 1 - tpr
    eer_idx = np.nanargmin(np.abs(fnr - fpr))
    eer = fpr[eer_idx]
    eer_threshold = thresholds[eer_idx]

    predictions_eer = (similarities >= eer_threshold).astype(int)
    accuracy_eer = np.mean(predictions_eer == labels)

    best_acc = 0
    best_threshold = 0
    for thresh in np.linspace(similarities.min(), similarities.max(), 200):
        preds = (similarities >= thresh).astype(int)
        acc = np.mean(preds == labels)
        if acc > best_acc:
            best_acc = acc
            best_threshold = thresh

    # TAR at specific FAR values
    tar_at_far = {}
    for far_target in [0.001, 0.01, 0.1]:
        idx = np.where(fpr <= far_target)[0]
        if len(idx) > 0:
            tar_at_far[far_target] = tpr[idx[-1]]

    return {
        'eer': eer,
        'eer_threshold': eer_threshold,
        'accuracy_at_eer': accuracy_eer,
        'best_accuracy': best_acc,
        'best_threshold': best_threshold,
        'roc_auc': roc_auc,
        'tar_at_far': tar_at_far,
        'fpr': fpr,
        'tpr': tpr,
        'thresholds': thresholds
    }

def plot_roc_curve(metrics):
    fpr = metrics['fpr']
    tpr = metrics['tpr']
    roc_auc = metrics['roc_auc']
    eer = metrics['eer']
    eer_threshold = metrics['eer_threshold']

    eer_idx = np.nanargmin(np.abs((1 - tpr) - fpr))

    plt.figure(figsize=(10, 6))
    plt.plot(fpr, tpr, 'b-', linewidth=2.5, label=f'ROC Curve (AUC = {roc_auc:.4f})')
    plt.plot([0, 1], [0, 1], 'k--', linewidth=1.5, label='Random Classifier')
    plt.plot(fpr[eer_idx], tpr[eer_idx], 'ro', markersize=12,
    label=f'EER = {eer:.4f} @ threshold = {eer_threshold:.3f}')
    plt.xlabel('False Positive Rate (FAR)', fontsize=13, fontweight='bold')
    plt.ylabel('True Positive Rate (TAR)', fontsize=13, fontweight='bold')
    plt.title('LFW Face Verification - ROC Curve', fontsize=15, fontweight='bold')
    plt.legend(fontsize=11, loc='lower right')
    plt.grid(True, alpha=0.3, linestyle='--')
    plt.xlim([-0.01, 1.01])
    plt.ylim([-0.01, 1.01])
    plt.tight_layout()
    plt.savefig('lfw_roc_curve.png', dpi=150, bbox_inches='tight')


    plt.show()

def plot_similarity_distributions(similarities, labels, eer_threshold):
    same_person_sims = similarities[labels == 1]
    diff_person_sims = similarities[labels == 0]

    plt.figure(figsize=(12, 5))
    plt.subplot(1, 2, 1)
    plt.hist(diff_person_sims, bins=50, alpha=0.6, label='Different persons',
             color='red', edgecolor='black')
    plt.hist(same_person_sims, bins=50, alpha=0.6, label='Same person',
             color='green', edgecolor='black')
    plt.axvline(eer_threshold, color='blue', linestyle='--', linewidth=2,
                label=f'EER Threshold = {eer_threshold:.3f}')
    plt.xlabel('Cosine Similarity', fontsize=12, fontweight='bold')
    plt.ylabel('Frequency', fontsize=12, fontweight='bold')
    plt.title('Similarity Score Distribution', fontsize=13, fontweight='bold')
    plt.legend(fontsize=10)
    plt.grid(True, alpha=0.3, axis='y')

    # Box plot
    plt.subplot(1, 2, 2)
    plt.boxplot([diff_person_sims, same_person_sims],
                labels=['Different', 'Same'],
                patch_artist=True,
                boxprops=dict(facecolor='lightblue', color='black'),
                medianprops=dict(color='red', linewidth=2))
    plt.axhline(eer_threshold, color='blue', linestyle='--', linewidth=2,
                label=f'EER Threshold = {eer_threshold:.3f}')
    plt.ylabel('Cosine Similarity', fontsize=12, fontweight='bold')
    plt.title('Similarity Score Distributions', fontsize=13, fontweight='bold')
    plt.grid(True, alpha=0.3, axis='y')
    plt.legend(fontsize=10)
    plt.tight_layout()
    plt.savefig('similarity_distributions.png', dpi=150, bbox_inches='tight')
    plt.show()

    print(f"Distributions saved to 'similarity_distributions.png'\n")

def evaluate_on_lfw_pairs(max_pairs=2000):
    pairs_data = fetch_lfw_pairs(subset='test')
    n_pairs = min(max_pairs, len(pairs_data.pairs))
    similarities, labels, failed = compute_similarity_scores(pairs_data, max_pairs)

    print(f"Successfully processed {len(similarities)} pairs")
    if failed > 0:
        print(f"Failed:{failed} pairs ({100*failed/n_pairs:.1f}%) - face detection issues")
    metrics = compute_metrics(similarities, labels)

    print("\n" + "="*70)
    print("EVALUATION RESULTS")
    print("="*70)
    print(f"\nEQUAL ERROR RATE (EER)")
    print(f"EER:{metrics['eer']:.4f} ({metrics['eer']*100:.2f}%)")
    print(f"EER Threshold:{metrics['eer_threshold']:.4f}")
    print(f"Accuracy at EER:{metrics['accuracy_at_eer']:.4f} ({metrics['accuracy_at_eer']*100:.2f}%)")
    print(f"\nBEST PERFORMANCE")
    print(f"Best Accuracy:{metrics['best_accuracy']:.4f} ({metrics['best_accuracy']*100:.2f}%)")
    print(f"Optimal Threshold:{metrics['best_threshold']:.4f}")


    print(f"\nROC METRICS")
    print(f"AUC (Area Under Curve):{metrics['roc_auc']:.4f}")

    if 0.001 in metrics['tar_at_far']:
        print(f"TAR @ FAR=0.1%:{metrics['tar_at_far'][0.001]:.4f} ({metrics['tar_at_far'][0.001]*100:.2f}%)")
    if 0.01 in metrics['tar_at_far']:
        print(f"TAR @ FAR=1%:{metrics['tar_at_far'][0.01]:.4f} ({metrics['tar_at_far'][0.01]*100:.2f}%)")
    if 0.1 in metrics['tar_at_far']:
        print(f"TAR @ FAR=10%:{metrics['tar_at_far'][0.1]:.4f} ({metrics['tar_at_far'][0.1]*100:.2f}%)")
    print(f"\nSuccessfully processed:{len(similarities)}/{n_pairs} pairs")
    print("="*70)

    print("\nGenerating visualizations")
    plot_roc_curve(metrics)
    plot_similarity_distributions(similarities, labels, metrics['eer_threshold'])

    same_person_sims = similarities[labels == 1]
    diff_person_sims = similarities[labels == 0]

    return {
        **metrics,
        'processed_pairs': len(similarities),
        'failed_pairs': failed,
        'same_person_mean': float(np.mean(same_person_sims)),
        'diff_person_mean': float(np.mean(diff_person_sims)),
        'similarities': similarities,
        'labels': labels
    }



if __name__ == "__main__":
    results = evaluate_on_lfw_pairs(max_pairs=2000)

